    state ={
        courses:[]
    }
    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/posts').then (
            response => 
            this.setState({courses:response.data})
        );
    }
    render() {
        let data = this.state.courses.slice(0,4);
    return <p>{data.map(course => course.body)}</p>;
